function Angulo($angulo, $lado){
    $angulo_novo = floatval($angulo);
    switch($lado){
        case 'd':
            if(($angulo_novo <= 90.0) && ($angulo_novo > 45.0)){
                $angulo_novo = 45.0;
            }
            elseif(($angulo_novo <= 315.0) && ($angulo_novo > 270.0)){
                $angulo_novo = 315.0;
            }
            break;
        case 's':
            if(($angulo_novo <= 180.0) && ($angulo_novo > 135.0)){
                $angulo_novo = 135.0;
            }
            elseif($angulo_novo < 45.0){
                $angulo_novo = 45.0;
            }
            
            break;
        case 'e':
            if(($angulo_novo <= 270.0) && ($angulo_novo > 225.0)){
                $angulo_novo = 225.0;
            }
            elseif($angulo_novo < 135.0){
                $angulo_novo = 135.0;
            }
            break;
        case 'i':
            if(($angulo_novo <= 360.0) && ($angulo_novo > 315.0)){
                $angulo_novo = 315.0;
            }
            elseif($angulo_novo < 225.0){
                $angulo_novo = 225.0;
            }
            break;
    }
    
    return $angulo_novo;
}

function Afastamento($angulo, $lado){
    
    $escala_1cm_e_m = 250.0;
    $afastamento_novo = 0.0;
    $ang_ref = 0.0;
    $fator = 1.0;

    switch($lado){
        case 'd':
            if($angulo > 180.0){
                $ang_ref = 360.0;
            }
            $fator = -1.0;
            break;
        case 's':
            $ang_ref = 90.0;
            break;
        case 'e':
            $ang_ref = 180.0;
            break;
        case 'i':
            $ang_ref = 270.0;
            $fator = -1.0;
            break;
    }

    $new_ang = $ang_ref - $angulo;
    if($new_ang != 0.0){
        $ang_b = 90.0 - abs($new_ang);
        $afastamento_novo = ($escala_1cm_e_m * sin(deg2rad($new_ang))) / sin(deg2rad($ang_b)) * $fator;
    }

    return round($afastamento_novo,1);
}

